import React from 'react'
import Option from './Option'

const OptionMaker = ({array,propertyName}) => {
  return (<>
      {array.map((obj,index)=>(<Option key={index} value={obj[propertyName]} text={obj[propertyName]}/>))}
   </>
  )
}

export default OptionMaker
